function Sidebar() {
  return (
    <div className="col-lg-2">
      <div className="side-bar bg-lightgray max-vh-100">
        <button type="button" className="btn btn-primary w-100 my-4 d-flex justify-content-between">
          <span>New Questions</span>
          <span><i className="far fa-plus"></i></span>
        </button>
        <ul className="list-group bg-transparent">
          <li className="list-group-item border-0 bg-transparent">Politics</li>
          <li className="list-group-item border-0 bg-transparent">Sports</li>
          <li className="list-group-item border-0 bg-transparent">Movies</li>
          <li className="list-group-item border-0 bg-transparent">History</li>
          <li className="list-group-item border-0 bg-transparent">Geography</li>
        </ul>
      </div>
    </div>
  );
}

export default Sidebar;
